import CompanyCard from "../../components/ui/CompanyCard/CompanyCard";
import { Container, Title, Wrap } from "./styled";

export default function Home() {
  return (
    <Wrap>
      <Title>Каталог компаний</Title>
      <Container>
        <CompanyCard img="https://www.figma.com/file/m01P58WA4EuwcckLrzgI8X/disign-(Copy)?type=design&node-id=4-129&mode=design&t=eOt1WucVPLjAuadt-4" title="Для авто" />
      </Container>
    </Wrap>
  );
}
